import React from 'react';
import { View } from 'react-native';

const Obstacles = ({
  color,
  obstacleLeft,
  obstacleHeight,
  obstacleWidth,
  gap,
}) => {
  return (
    <>
      <View
        style={{

          position: 'absolute',
          backgroundColor: color,
          width: obstacleWidth,
          height: obstacleHeight,
          left: obstacleLeft,
          bottom: 0 + obstacleHeight + gap,
        }}
      />

      <View
        style={{
          position: 'absolute',
          backgroundColor: color,
          width: obstacleWidth,
          height: obstacleHeight,
          left: obstacleLeft,
          bottom: 0,
        }}
      />
    </>
  );
};

export default Obstacles;
